import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { lugarModel } from '../models/lugarModel';
import { catchError, map } from 'rxjs/operators';
import { Observable, throwError } from 'rxjs';
import { paisModel } from '../models/paisModel';
@Injectable({
  providedIn: 'root'
})
export class lugarService {
  updateLugar(value: any) {
    throw new Error('Method not implemented.');
  }

  constructor(private http: HttpClient) { }
  domain: string="http://localhost:3000";
  getLugar() {
    return this.http.get<lugarModel[]>(`${this.domain}/api/lugar`).pipe(
      map(res => res)
    );
  }

  addLugar(newLugar: lugarModel){
    return this.http.post<lugarModel>(`${this.domain}/api/lugar`,newLugar).pipe(
      map(res => res)
      );
  }

  deleteLugar(id: string){
    return this.http.delete<lugarModel>(`${this.domain}/api/lugar/${id}`).pipe(
      map(res => res)
      );
  }
  update(newLugar: lugarModel) {
    return this.http.put(`${this.domain}/api/lugar/${newLugar._id}`, newLugar).pipe(
      map(res => res)
    );
  }
  getPaises(): Observable<paisModel[]> {
    return this.http.get<paisModel[]>(`${this.domain}/api/pais`).pipe(
      catchError((error: any) => throwError('Error al cargar Paises'))
    );
  }
}
